import { ThemeProvider } from "@mui/styles";
import React from "react";
import useStyles from "./styles";

const Form = () => {
  const theme = createTheme({
    status: {
      danger: orange[500],
    },
  });
  return (
    <ThemeProvider theme={theme}>
      <h1>FORM</h1>
    </ThemeProvider>
  );
};

export default Form;
